INSERT INTO `items` VALUES (1,'Burning Blood','Your body\'s own blood burns with an undying rage.',1),(2,'Ring of the Snake','Made from a fossilized snake. Represents great skill as a huntress.',1),(3,'Cracked Core','The mysterious life force which powers the Automatons within the Spire. It appears to be cracked.',1),(4,'Pure Water','Filtered through fine sand and free of impurities.',1),(5,'Akabeko','Muuu~',1),(6,'Anchor','Holding this miniature trinket, you feel heavier and more stable.',1),(7,'Ancient Tea Set','The key to a refreshing night\'s rest.',1),(8,'Art of War','This ancient manuscript contains wisdom from a past age.',1),(9,'Bag of Marbles','A once popular toy in the City. Useful for throwing enemies off balance.',1),(10,'Bag of Preparation','Oversized adventurer\'s pack. Has many pockets and straps.',1),(11,'Blood Vial','A vial containing the blood of a pure and elder vampire.',1),(12,'Bronze Scales','The sharp scales of the Guardian. Rearranges itself to protect its user.',1),(13,'Centennial Puzzle','Upon solving the puzzle you feel a powerful warmth in your chest.',1),(14,'Ceramic Fish','Meticulously painted, these fish were revered to bring great fortune.',1),(15,'Dream Catcher','The northern tribes would often use dream catchers at night, believing they led to self improvement.',1),(16,'Happy Flower','This unceasingly joyous plant is a popular novelty item among nobles.',1),(17,'Juzu Bracelet','A ward against the unknown.',1),(18,'Lantern','An eerie lantern which illuminates only for the wielder.',1),(19,'Maw Bank','Surprisingly popular, despite maw attacks being a regular occurrence.',1),(20,'Meal Ticket','Complimentary meatballs with every visit!',1),(21,'Nunchaku','A good training tool. Improves the posture and agility of the wielder.',1),(22,'Oddly Smooth Stone','You have never seen something so smooth and pristine. This must be the work of the Ancients.',1),(23,'Omamori','A common charm for staving off vile spirits. This one seems to possess a spark of divine energy.',1),(24,'Orichalcum','A green tinted metal of an unknown origin. Seemingly indestructible.',1),(25,'Pen Nib','Holding the nib, you can see everyone ever slain by a previous owner of the pen. A violent history.',1),(26,'Potion Belt','I can hold more Potions using this belt!',1),(27,'Preserved Insect','The insect seems to create a shrinking aura that targets particularly large enemies.',1),(28,'Regal Pillow','Now you can get a proper night\'s rest.',1),(29,'Smiling Mask','Mask worn by the merchant. He must have spares...',1),(30,'Strawberry',' - Ranwid',1),(31,'The Boot','When wound up, the boot grows larger in size.',1),(32,'Tiny Chest',' - The Architect',1),(33,'Toy Ornithopter','This little toy is the perfect companion for the lone adventurer!',1),(34,'Vajra','An ornamental relic given to warriors displaying glory in battle.',1),(35,'War Paint','In the past, Ironclads would create wards using enchanted war paint before charging into battle.',1),(36,'Whetstone',' - Kublai the Great',1),(37,'Red Skull','A small skull covered in ornamental paint.',1),(38,'Snecko Skull','A snecko skull in pristine condition. Mysteriously clean and smooth, dirt and grime fall off inexplicably.',1),(39,'Data Disk','This disk contains precious data on birds and snakes.',1),(40,'Damaru','The sound of the small drum keeps your mind awake, revealing a path forward.',1),(41,'Blue Candle','The flame ignites when shrouded in darkness.',1),(42,'Bottled Flame','Inside the bottle resides a flame that eternally burns.',1),(43,'Bottled Lightning','Peering into the swirling maelstrom, you see a part of yourself staring back.',1),(44,'Bottled Tornado','The bottle gently hums and whirs.',1),(45,'Darkstone Periapt','This stone draws power from dark energy, converting it into vitality for the wearer.',1),(46,'Eternal Feather','This feather appears to be completely indestructible. What bird does this possibly come from?',1),(47,'Molten Egg','The egg of a Phoenix. It glows red hot with a simmering lava.',1),(48,'Toxic Egg',' - Ranwid',1),(49,'Frozen Egg','The egg lies inert and frozen, never to hatch.',1),(50,'Gremlin Horn',' - Ranwid',1),(51,'Horn Cleat','Pleasant to hold in the hand. What was it for?',1),(52,'Ink Bottle','Once exhausted, appears to refill itself in a different color.',1),(53,'Kunai','A blade favored by assassins for its lethality at range.',1),(54,'Letter Opener','Unnaturally sharp.',1),(55,'Matryoshka','A stackable set of painted dolls. The paint depicts an unknown bird with white eyes and blue feathers.',1),(56,'Meat on the Bone','The meat keeps replenishing, never seeming to fully run out.',1),(57,'Mercury Hourglass','An enchanted hourglass that endlessly drips.',1),(58,'Mummified Hand','Frequently twitches, especially when your pulse is high.',1),(59,'Ornamental Fan','The fan seems to extend and harden as blood is spilled.',1),(60,'Pantograph',' - The Architect',1),(61,'Pear','A common fruit before the Spireblight.',1),(62,'Question Card',' - Kublai the Great',1),(63,'Skuriken','Lightweight throwing weapons. Recommend going for the eyes.',1),(64,'Singing Bowl','This well-used artifact rings out with a beautiful melody when struck.',1),(65,'Strike Dummy','It\'s beat up.',1),(66,'Sundial',' - Zoroth',1),(67,'The Courier','The merchant\'s personal pet!',1),(68,'White Beast Statue','A small white statue of a creature you have never seen before.',1),(69,'Paper Phrog','The paper continually folds and unfolds itself into the shape of a small creature.',1),(70,'Self-Forming Clay',' - Ranwid',1),(71,'Ninja Scroll','Contains the secrets of assassination.',1),(72,'Paper Krane','An origami of a creature from a past age.',1),(73,'Gold-Plated Cables',' -Ranwid',1),(74,'Symbiotic Virus','A little bit of bad can do a lot of good.',1),(75,'Duality',' - Zoroth',1),(76,'Teardrop Locket','Its owner blind, its content unseen.',1),(77,'Bird-Faced Urn','This urn shows the crow god Mazaleth looking mischievous.',1),(78,'Calipers',' - The Architect',1),(79,'Captain\'s Wheel','Wood trinket carved with delicate precision. A name is carved into it but the language is foreign.',1),(80,'Dead Branch','The branch of a tree from a forgotten era.',1),(81,'Du-Vu Doll','A doll devised to gain strength from malicious energy.',1),(82,'Fossillized Helix','Seemingly indestructible, you wonder what kind of creature this belonged to.',1),(83,'Gambling Chip','Bear\'s Lucky Chip!',1),(84,'Ginger','A potent tool in many tonics.',1),(85,'Girya','This Girya is unfathomably heavy. You could train with this to get significantly stronger.',1),(86,'Ice Cream','Delicious!',1),(87,'Incense Burner','The smoke imbues its owner with the spirit of the burned.',1),(88,'Lizard Tail','A fake tail to trick enemies during combat.',1),(89,'Mango','The most coveted forgotten fruit. Impeccably preserved with no signs of Spireblight.',1),(90,'Old Coin','Unique coins are highly valued by Merchants for their historical value and rare metallic composition.',1),(91,'Peace Pipe','Clears the mind and cleanses the soul.',1),(92,'Pocketwatch','The hands seem stuck on the 3 o\'clock position.',1),(93,'Prayer Wheel','The wheel continues to spin, never stopping.',1),(94,'Shovel','The Spire houses all number of relics from past civilizations and powerful adventurers lost to time. Time to go dig them up!',1),(95,'Stone Calendar','The passage of time is imperceptible in the Spire.',1),(96,'Thread and Needle','Wrapping the magical thread around your body, you feel harder to the touch.',1),(97,'Torii','Holding the small Torii, you feel a sense of calm and safety drift through your mind.',1),(98,'Tungsten Rod','It\'s very very heavy.',1),(99,'Turnip','Best with ginger.',1),(100,'Unceasing Top','The top continues to spin effortlessly as if you were in a dream.',1),(101,'Wing Boots','Stylish.',1),(102,'Champion Belt','Only the greatest may wear this belt.',1),(103,'Charon\'s Ashes','Charon was said to be the god of rebirth, eternally dying and reviving in a burst of flame.',1),(104,'Magic Flower','A flower long thought extinct, somehow preserved in perfect condition.',1),(105,'The Specimen',' - Ranwid',1),(106,'Tingsha','The sound this instrument generates seems to be capable of reverberating to painful levels of volume.',1),(107,'Tough Bandages','Loss gives strength.',1),(108,'Emotion Chip','...<3...?',1),(109,'Cloak Clasp','A simple but sturdy design.',1),(110,'Golden Eye','See into the minds of those nearby, predicting their future moves.',1),(111,'Cauldron','The Merchant is actually a rather skilled potion brewer. Buy 4 get 1 free.',1),(112,'Chemical X','WARNING: Do not combine with sugar, spice, and everything nice.',1),(113,'Clockwork Souvenir','So many intricate gears.',1),(114,'Dolly\'s Mirror','I look funny in this.',1),(115,'Frozen Eye','Staring into the eye, you see a glimpse of your future.',1),(116,'Hand Drill','Spirals are dangerous.',1),(117,'Lee\'s Waffle','Tastiest treat you will find in all the Spire! Baked today just for you.',1),(118,'Medical Kit','Has everything you need! Anti-itch, anti-burn, anti-venom, and more!',1),(119,'Membership Card','Bonus membership offer for my most valuable customers!',1),(120,'Orange Pellets','Made from various fungi found throughout the Spire, they will stave off any affliction.',1),(121,'Orrery',' - Zoroth',1),(122,'Prismatic Shard','Looking through the shard, you are able to see entirely new perspectives.',1),(123,'Sling of Courage','A handy tool for dealing with particularly tough opponents.',1),(124,'Strange Spoon','Staring at the spoon, it appears to bend and twist around before your eyes.',1),(125,'Abacus','One...Two...Three...',1),(126,'Toolbox','A tool for every job.',1),(127,'Brimstone','Emanates an infernal heat.',1),(128,'Twisted Funnel','I wouldn\'t drink out of it.',1),(129,'Runic Capacitor','More is better.',1),(130,'Melange','Mysterious sands from an unknown origin. Smells of cinnamon.',1),(131,'Astrolabe','A tool to glean invaluable knowledge from the stars.',1),(132,'Black Star','Originally discovered in the town of the serpent, beside a solitary candle.',1),(133,'Busted Crown','The Champ\'s crown... or a pale imitation?',1),(134,'Calling Bell','This dark iron bell rang 3 times when you found it, but now stays silent.',1),(135,'Coffee Dripper',' -The Architect',1),(136,'Cursed Key','You can feel the malicious energy emanating from the key. Power comes at a price.',1),(137,'Ectoplasm','This blob of slime and energy seems to pulse with life.',1),(138,'Empty Cage',' -Ranwid',1),(139,'Fusion Hammer','Once wielded, the owner can never let go.',1),(140,'Pandora\'s Box','You have a bad feeling about opening this.',1),(141,'Philosopher\'s Stone','Raw energy emanates from the stone, empowering all nearby.',1),(142,'Runic Dome','The runes are indecipherable.',1),(143,'Runic Pyramid','The runes are indecipherable.',1),(144,'Sacred Bark','A bark rumored to originate from the World tree.',1),(145,'Slaver\'s Collar','Rusty miserable chains.',1),(146,'Snecko Eye','An eye of a fallen snecko. Much larger than you imagined.',1),(147,'Sozu','You notice that magical liquids seem to lose their properties when near this relic.',1),(148,'Tiny House',' - The Architect',1),(149,'Velvet Choker',' - Kublai the Great',1),(150,'Mark of Pain','This brand was used by the northern tribes to signify warriors who had mastered pain in battle.',1),(151,'Runic Cube','The runes are indecipherable.',1),(152,'Wrist Blade','Handy for assassinations.',1),(153,'Hovering Kite','The Kite floats around you in battle, propelled by a mysterious force.',1),(154,'Inserter','Push. Pull. Stack. Repeat.',1),(155,'Nuclear Battery','Ooooh...',1),(156,'Violet Lotus',' were littered with these flowers.',1),(157,'Black Blood','The rage grows darker.',1),(158,'Ring of the Serpent','Your ring has morphed and changed forms.',1),(159,'Frozen Core','The crack in your core has been filled with a pulsating cold energy.',1),(160,'Holy Water','Collected from a time before the Spire.',1),(161,'Neow\'s Lament','The blessing of lamentation bestowed by Neow.',1),(162,'Golden Idol','Made of solid gold, you feel richer just holding it.',1),(163,'Bloody Idol','The idol now weeps a constant stream of blood.',1),(164,'Face of Cleric','Everyone loves Cleric.',1),(165,'Ssserpent Head','The most fulfilling of lives is that in which you can buy anything!',1),(166,'Gremlin Visage','Time to run.',1),(167,'N\'Loth\'s Hungry Face','You feel hungry.',1),(168,'Cultist Headpiece','Part of the Flock!',1),(169,'Odd Mushroom',' - Ranwid',1),(170,'Necronomicon','Only a fool would try and harness this evil power. At night your dreams are haunted by images of the book devouring your mind.',1),(171,'Nilry\'s Codex','Crafted by the infamous game master himself. Said to expand one\'s mind.',1),(172,'Enchiridion','The legendary journal of an ancient lich.',1),(173,'Red Mask','This very stylish looking mask belongs to the leader of the Red Mask Bandits. Technically that makes you the leader now?',1),(174,'Mutagenic Strength',' - Unknown',1),(175,'N\'loth\'s Gift','The strange gift from N\'loth. Whenever you try and unwrap it, another wrapped box of the same size lies within.',1),(176,'Warped Tongs','The cursed tongs emit a strong desire to return to where they were stolen from.',1),(177,'Mark of the Bloom','In the Beyond, thoughts and reality are one.',1),(178,'Spirit Poop','The charred remains of your offering to the spirits.',1),(179,'Circlet','Collect as many as you can.',1),(180,'Batter\'s Helmet','You\'ll be batting a thousand (skulls in) when you don this red piece of plastic! ',2),(181,'Soldier\'s Stash','This hat does not in any way, shape, or form, promote smoking or gambling.',2),(182,'Mining Light','For Engineers with bright ideas. ',2),(183,'Prussian Pickelhaube','A relic from one war brought into another. Your enemy will get the point.',2),(184,'Trophy Belt','Any old sap can pull teeth from a dead crocodile. It takes a man to pull teeth from a live one.',2),(185,'Fancy Fedora','This smooth, suave, silk-lined beauty can turn any amateur backstabber into a handsome rogue. ',2),(186,'Baseball Bill\'s Sports Shine','Everyone knows that speed is a Scout\'s best friend. Why weigh yourself down with bulky hats when you can break the sound barrier without them? ',2),(187,'Ye Olde Baker Boy','Extra! Extra! You\'re frickin\' dead! ',2),(188,'Bonk Helm','When drinking one radioactive beverage at a time is not enough. ',2),(189,'Tyrant\'s Helm','I kicked your ass so hard it went back in time and got me this VIKING HAT. ',2),(190,'Stainless Pot','Protects cranium from bullets and shrapnel. Also heats soup. ',2),(191,'Respectless Rubber Glove','It doesn\'t matter how much people respect you when they\'re on fire. ',2),(192,'Officer\'s Ushanka','This hat was made of bear hands. That bear was killed with bare hands. ',2),(193,'Tough Guy\'s Toque','Because when you\'re the toughest Mother Hubbard in the fort, nobody\'s criticizing your fashion sense. ',2),(194,'Texas Slim\'s Dome Shine','Sometimes you just need a little less hat. ',2),(195,'Texas Ten Gallon','Though it looks like a simple ten-gallon hat, this modern feat of engineering actually contains more moving parts than a level 2 Sentry Gun. ',2),(196,'Otolaryngologist\'s Mirror','We can\'t pronounce it either. ',2),(197,'Ritzy Rick\'s Hair Fixative','His bullet was close. I lost my hat. My bullet was closer. He lost his head.',2),(198,'Professional\'s Panama','A polite, efficient hat to wear when killing everyone you meet. ',2),(199,'Master\'s Yellow Belt','Only a master of Jarate earns the right to wear this once-white bandanna, stained yellow from the rigors of a harsh training regimen. ',2),(200,'Backbiter\'s Billycock','For when you wish your head was a little taller, but just as round on top. ',2),(201,'Gentle Manne\'s Service Medal','Given to those few brave soldiers whom stood guard valiantly without sleep, nourishment, or a social life. ',2),(202,'Camera Beard','You wouldn\'t